def approxPatterns(text, patterns, d):
    finalList = []
    for pattern in patterns:
        finalList.extend(approxPattern(pattern, text, d))
    return sorted(finalList)

def approxPattern(pattern, dna, hamDist):
    subLen = len(pattern)
    indexList = []
    for i in range(len(dna) - subLen + 1):
        subStr = dna[i:i+subLen]
        if (hammingDistance(subStr, pattern) <= hamDist):
            indexList.append(str(i))

    return indexList

def hammingDistance(dna1, dna2):
    hammingDist = 0
    for i in range(len(dna1)):
        if (dna1[i] != dna2[i]):
            hammingDist += 1

    return hammingDist


patterns = []
f = open("patterns.txt", "r")
f1 = f.read().split()
for pattern in f1:
    patterns.append(pattern.strip('\n'))
f.close()

print(' '.join(map(str, approxPatterns('', patterns, 2))))